                    { 4, "FR", "1º dígito: Exerc. Atual = 1, Exerc. Anterior = 2 / 2º ao 4º dígito = classificação por fonte ou destinação de recursos 5º ao 8º dígito = Detalhamento da fonte ou destinação de recursos.", 8, 2021, "Permite o acompanhamento da origem e destinação dos recursos legalmente vinculados a órgão, fundo ou despesa, possibilitando a identificação, pelo Siconfi, das informações necessárias à elaboração de demonstrativos fiscais integrantes do RREO e do RGF.", "Fonte ou Destinação de Recursos" },
                    { 3, "DC", "1 – não compõem a DC.", 1, 2021, "Tem como objetivo a identificação de parte do passivo originário de financiamento ou operação de crédito equiparada, contratada com prazo de amortização inferior a 12 meses, que, conforme definido na Lei de Responsabilidade Fiscal – LRF, não integra a dívida consolidada. Esse marcador não identificará o total da dívida consolidada, mas sim o conjunto de contas em que parte do saldo poderá não integrar a DC. ", "Dívida Consolidada" },
