                    { 3591, "1", "4", "1", "01", "Registra receitas originadas da Contribuição Previdenciária para o RGPS de: I - empresa: firma individual ou sociedade que assume o risco de atividade econômica urbana ou rural, com fins lucrativos ou não, bem como dos órgãos e das entidades da administração pública direta, indireta e fundacional para contribuintes não optantes pelo Simples Nacional; II - empregador doméstico: a pessoa ou família que admite a seu serviço, sem finalidade lucrativa, empregado doméstico; Equiparam-se a empresa, para fins previdenciários, o contribuinte individual e a pessoa física na condição de proprietário ou dono de obra de construção civil, em relação a segurado que lhe presta serviço, bem como a cooperativa, a associação ou a entidade de qualquer natureza ou finalidade, a missão diplomática e a repartição consular de carreira estrangeiras.", "1", "Contribuição Previdenciária do Empregador ou Equiparado - Contribuintes Não Optantes pelo Simples Nacional", 2021, "12140110", "Portaria SEAFI nº 25, de 24 de Abril de 2019 (SOF)", "2", "0", "NÃO" },
