                    { 3452, "1", "0", "1", "04", "Agrega as receitas oriundas da contribuição incidentes sobre: a veiculação, a produção, o licenciamento, a distribuição de obras cinematográficas e videofonográficas com fins comerciais; a prestação de serviços que se utilizem de meios que possam, efetiva ou potencialmente, distribuir conteúdos audiovisuais; a veiculação ou distribuição de obra audiovisual publicitária incluída em programação internacional; e o pagamento, o crédito, o emprego, a remessa ou a entrega, aos produtores, distribuidores ou intermediários no exterior, de importâncias relativas a rendimento decorrente da exploração de obras cinematográficas e videofonográficas ou por sua aquisição ou importação, a preço fixo.", "2", "Contribuição para o Desenvolvimento da Indústria Cinematográfica Nacional - CONDECINE", 2021, "12200410", null, "2", "0", "NÃO" },
