                    { 3462, "1", "0", "1", "05", "Agrega as receitas relativas à Cota-Parte do Adicional ao Frete para Renovação da Marinha Mercante - AFRMM, que destina-se a atender aos encargos da intervenção da União no apoio ao desenvolvimento da marinha mercante e da indústria de construção e reparação naval brasileiras, e constitui fonte básica do Fundo da Marinha Mercante - FMM. Esta contribuição incide sobre o frete, que é a remuneração do transporte aquaviário da carga de qualquer natureza, descarregada em porto brasileiro, com alíquotas de 10%, 25% e 40%, segundo o tipo de transporte.", "2", "Cota-Parte do Adicional ao Frete para a Renovação da Marinha Mercante - AFRMM", 2021, "12200510", null, "2", "0", "NÃO" },
