                    { 2954, "1", "1", "2", "02", "Vide descrição do código de receita principal.", "4", "Royalties Mínimos pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade antes de 3/12/2012 - Área e Camada Pré-Sal - Principal", 2021, "13410221", null, "3", "1", "SIM" },
                    { 2953, "1", "1", "2", "02", "Agrega as receitas oriundas da parcela do valor do royalty, previsto no contrato de concessão, que representar 5% do valor da produção de petróleo, gás natural ou outros hidrocarbonetos fluidos, quando a lavra ocorrer na plataforma continental, no mar territorial ou na zona econômica exclusiva, em contratos cuja declaração de comercialidade tenha ocorrido antes de 3/12/2012, em áreas no horizonte geológico denominado Pré-Sal*, em campos localizados na área definida no inciso IV do caput do art. 2o da Lei no 12.351, de 2010. * Entende-se por horizonte geológico denominado Pré-Sal o intervalo de rochas que se estende por baixo de uma extensa camada de sal, localizado em áreas de águas profundas, em grande parte do litoral brasileiro.", "4", "Royalties Mínimos pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade antes de 3/12/2012 - Área e Camada Pré-Sal", 2021, "13410220", null, "3", "0", "NÃO" },
                    { 2952, "1", "1", "1", "02", "Vide descrição do código de receita principal.", "4", "Royalties Mínimos pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão - Juros de Mora da Dívida Ativa", 2021, "13410218", null, "3", "8", "SIM" },
                    { 2951, "1", "1", "1", "02", "Vide descrição do código de receita principal.", "4", "Royalties Mínimos pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão - Dívida Ativa - Multas da Dívida Ativa", 2021, "13410217", null, "3", "7", "SIM" },
                    { 2950, "1", "1", "1", "02", "Vide descrição do código de receita principal.", "4", "Royalties Mínimos pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão - Juros de Mora", 2021, "13410216", null, "3", "6", "SIM" },
