                    { 2948, "1", "1", "1", "02", "Vide descrição do código de receita principal.", "4", "Royalties Mínimos pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão - Dívida Ativa - Multas e Juros de Mora da Dívida Ativa", 2021, "13410214", null, "3", "4", "SIM" },
