                    { 2945, "1", "1", "1", "02", "Vide descrição do código de receita principal.", "4", "Royalties Mínimos pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão - Principal", 2021, "13410211", null, "3", "1", "SIM" },
                    { 2943, "1", "1", "0", "02", "Agrega as receitas oriundas da produção de petróleo, gás natural ou outros hidrocarbonetos fluidos, quando a lavra ocorrer sob o regime de concessão.", "4", "Royalties Mínimos pela Produção de Petróleo - Contrato de Concessão", 2021, "13410200", null, "3", "0", "NÃO" },
                    { 2962, "1", "1", "3", "02", "Agrega as receitas oriundas da parcela do valor do royalty, previsto no contrato de concessão, que representar 5% do valor da produção de petróleo, gás natural ou outros hidrocarbonetos fluidos, quando a lavra ocorrer na plataforma continental, no mar territorial ou na zona econômica exclusiva, em contratos cuja declaração de comercialidade tenha ocorrido antes de 3/12/2012, fora do horizonte geológico* e das áreas do pré-sal** e estratégicas. * Entende-se por horizonte geológico denominado Pré-Sal o intervalo de rochas que se estende por baixo de uma extensa camada de sal, localizado em áreas de águas profundas, em grande parte do litoral brasileiro. **A área do pré-sal é definida pelo inciso IV do art. 2o da Lei no 12.351, de 22 de dezembro de 2010, como a “região do subsolo formada por um prisma vertical de profundidade indeterminada, com superfície poligonal definida pelas coordenadas geográficas de seus vértices estabelecidas no Anexo desta Lei, bem como outras regiões que venham a ser delimitadas em ato do Poder Executivo, de acordo com a evolução do conhecimento geológico”.", "4", "Royalties Mínimos pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade antes de 3/12/2012 - Demais Situações", 2021, "13410230", null, "3", "0", "NÃO" },
