                    { 4389, "2", "3", "1", "00", "Agrega as receitas decorrentes de empréstimos compulsórios. O art. 148 da Constituição estabelece que a União, mediante lei complementar, poderá instituir empréstimos compulsórios para atender a despesas extraordinárias, decorrentes de calamidade pública, de guerra externa ou sua iminência; e no caso de investimento público de caráter urgente e de relevante interesse nacional.", "1", "Empréstimos Compulsórios", 2021, "21130010", null, "1", "0", "NÃO" },
