                    { 4353, "2", "1", "1", "00", "Vide descrição do código de receita principal.", "1", "Títulos de Responsabilidade do Tesouro Nacional - Mercado Interno - Multas e Juros de Mora", 2021, "21110012", null, "1", "2", "SIM" },
                    { 4352, "2", "1", "1", "00", "Vide descrição do código de receita principal.", "1", "Títulos de Responsabilidade do Tesouro Nacional - Mercado Interno - Principal", 2021, "21110011", null, "1", "1", "SIM" },
                    { 4236, "1", "2", "1", "04", "Vide descrição do código de receita principal.", "2", "Restituição de Benefícios Assistenciais - Principal", 2021, "19220411", null, "9", "1", "SIM" },
                    { 4351, "2", "1", "1", "00", "Agrega recursos provenientes da colocação, no mercado interno, de títulos de responsabilidade do Tesouro Nacional, conforme autorizado na Lei nº 10.179, de 6 de fevereiro de 2001, e com as características definidas no Decreto nº 3.859, de 4 de julho de 2001, destinados aos diversos fins especificados em normativos legais, excetuados aqueles destinados ao refinanciamento da dívida pública federal.", "1", "Títulos de Responsabilidade do Tesouro Nacional - Mercado Interno", 2021, "21110010", null, "1", "0", "NÃO" },
                    { 4349, "2", "0", "0", "00", "Agrega as operações de crédito internas, que compreendem os recursos decorrentes da colocação no mercado interno de títulos públicos, financiamentos ou empréstimos obtidos no país junto a entidades estatais ou particulares.", "1", "Operações de Crédito - Mercado Interno", 2021, "21100000", null, "1", "0", "NÃO" },
                    { 4348, "2", "0", "0", "00", "Agrega as operações de crédito, que são compromissos financeiros assumidos em razão de mútuo, abertura de crédito, emissão e aceite de título, aquisição financiada de bens, recebimento antecipado de valores provenientes da venda a termo de bens e serviços, arrendamento mercantil e outras operações assemelhadas, inclusive com o uso de derivativos financeiros. Equipara-se, ainda, à operação de crédito, a assunção, o reconhecimento ou a confissão de dívidas pelo ente da Federação.", "0", "Operações de Crédito", 2021, "21000000", null, "1", "0", "NÃO" },
                    { 4347, "2", "0", "0", "00", "Agrega as receitas de capital, que são as provenientes da realização de recursos financeiros oriundos de constituição de dívidas; da conversão, em espécie, de bens e direitos; além dos recursos recebidos de outras pessoas de direito público ou privado, destinados a atender despesas classificáveis em despesas de capital.", "0", "Receitas de Capital", 2021, "20000000", null, "0", "0", "NÃO" },
                    { 4346, "1", "2", "1", "99", "Vide descrição do código de receita principal.", "2", "Outras Restituições - Multas e Juros de Mora", 2021, "19229912", null, "9", "2", "SIM" },
                    { 4345, "1", "2", "1", "99", "Vide descrição do código de receita principal.", "2", "Outras Restituições - Principal", 2021, "19229911", null, "9", "1", "SIM" },
                    { 4344, "1", "2", "1", "99", "Agrega receitas decorrentes de restituições não classificadas nos itens anteriores.", "2", "Outras Restituições", 2021, "19229910", null, "9", "0", "NÃO" },
                    { 4343, "1", "2", "0", "99", "Agrega receitas decorrentes de restituições não classificadas nos itens anteriores.", "2", "Outras Restituições", 2021, "19229900", null, "9", "0", "NÃO" },
                    { 4342, "1", "2", "1", "13", "Vide descrição do código de receita principal.", "2", "Restituição de Contribuições para a Previdência Complementar do Servidor Público - Juros de Mora da Dívida Ativa", 2021, "19221318", null, "9", "8", "SIM" },
                    { 4350, "2", "1", "0", "00", "Agrega recursos provenientes da colocação, no mercado interno, de títulos de responsabilidade do Tesouro Nacional, conforme autorizado na Lei nº 10.179, de 6 de fevereiro de 2001, e com as características definidas no Decreto nº 3.859, de 4 de julho de 2001, destinados aos diversos fins especificados em normativos legais. Os títulos da dívida pública podem ser emitidos com três finalidades: financiar o déficit orçamentário; realizar operações com fins específicos, definidos em lei; e operacionalizar a política monetária. Registra o valor da receita decorrente da colocação no mercado interno de títulos do governo federal, estadual ou municipal.", "1", "Títulos de Responsabilidade do Tesouro Nacional - Mercado Interno", 2021, "21110000", null, "1", "0", "NÃO" },
                    { 4235, "1", "2", "1", "04", "Agrega receitas provenientes de restituição dos benefícios oriundos de pagamentos de Encargos Previdenciários da União - EPU, bem como dos Benefícios de Prestação Continuada - BPC e de Renda Mensal Vitalícia - RMV, conforme a Lei nº 8.472, de 2007 e o Decreto nº 6.214, de 2007.", "2", "Restituição de Benefícios Assistenciais", 2021, "19220410", null, "9", "0", "NÃO" },
                    { 4234, "1", "2", "0", "04", "Agrega receitas provenientes de restituição dos benefícios oriundos de pagamentos de Encargos Previdenciários da União - EPU, bem como dos Benefícios de Prestação Continuada - BPC e de Renda Mensal Vitalícia - RMV, conforme a Lei nº 8.472, de 2007 e o Decreto nº 6.214, de 2007.", "2", "Restituição de Benefícios Assistenciais", 2021, "19220400", null, "9", "0", "NÃO" },
