                    { 4114, "1", "0", "1", "11", "Agrega as receitas decorrentes da inobservância ou descumprimento de obrigações acessórias previstas na legislação previdenciária, tais como multas relacionadas ao atraso no envio de informações da Guia de Recolhimento do Fundo de Garantia por Tempo de Serviço e Informações à Previdência Social - GFIP; multas relacionadas à falta de envio, pelos titulares de Cartórios de Registro Civil de Pessoas Naturais à Previdência Social, do registro dos óbitos ocorridos no mês imediatamente anterior; multas relacionadas à não comunicação, pela empresa, de ocorrência de acidente de trabalho ou morte de seus empregados; multas relacionadas à situação em que o empregador não desconta ou desconta em atraso, da remuneração dos segurados ao seu serviço, a importância proveniente de dívida ou responsabilidade por eles contraída junto à seguridade social, relativa a benefícios pagos indevidamente; e multas aplicadas pelo juiz ou tribunal ao litigante de má-fé nos casos em que o INSS figura como parte no processo, dentre outras.", "1", "Multa por Descumprimento de Obrigação Previdenciária Acessória", 2021, "19101110", null, "9", "0", "NÃO" },
                    { 4113, "1", "0", "0", "11", "Agrega as receitas decorrentes da inobservância ou descumprimento de obrigações acessórias previstas na legislação previdenciária, tais como multas relacionadas ao atraso no envio de informações da Guia de Recolhimento do Fundo de Garantia por Tempo de Serviço e Informações à Previdência Social - GFIP; multas relacionadas à falta de envio, pelos titulares de Cartórios de Registro Civil de Pessoas Naturais à Previdência Social, do registro dos óbitos ocorridos no mês imediatamente anterior; multas relacionadas à não comunicação, pela empresa, de ocorrência de acidente de trabalho ou morte de seus empregados; multas relacionadas à situação em que o empregador não desconta ou desconta em atraso, da remuneração dos segurados ao seu serviço, a importância proveniente de dívida ou responsabilidade por eles contraída junto à seguridade social, relativa a benefícios pagos indevidamente; e multas aplicadas pelo juiz ou tribunal ao litigante de má-fé nos casos em que o INSS figura como parte no processo, dentre outras.", "1", "Multa por Descumprimento de Obrigação Previdenciária Acessória", 2021, "19101100", null, "9", "0", "NÃO" },
