                    { 4714, "2", "0", "1", "04", "Vide descrição do código de receita principal.", "0", "Amortização de Empréstimos - Refinanciamento de Dívidas de Médio e Longo Prazo - Principal", 2021, "23000411", null, "3", "1", "SIM" },
                    { 4713, "2", "0", "1", "04", "Agrega as receitas oriundas da amortização de empréstimos, financiamentos e refinanciamentos concedidos pela União, no âmbito do programa de refinanciamento da dívida externa, o Plano Brady. O Plano Brady foi um acordo firmado ao amparo da Resolução do Senado Federal nº 98, de 1992, alterada pelas Resoluções nº 90 e 132, ambas de 1993, reestruturando a dívida de médio e longo prazos (principal vencido e vincendo, assim como juros devidos e não pagos no período de 1º de janeiro de 1991 a 15 de abril de 1994) do setor público brasileiro junto aos credores privados estrangeiros, mediante emissão em 15/04/1994 de sete tipos de bônus pela União: Debt Conversion Bond, New Money Bond, Flirb, C - Bond, Discount Bond, Par Bond e EI Bond. A contratação do financiamento interno com os mutuários originais, formalizando o repasse das condições financeiras do acordo com prestações semestrais em abril e outubro, foi autorizada pelas Portarias MF nº 89, de 1996, nº 192, de 1996, nº 168, de 1997 e nº 364, de 2000, com termo em 15 de abril de 2024.", "0", "Amortização de Empréstimos - Refinanciamento de Dívidas de Médio e Longo Prazo", 2021, "23000410", null, "3", "0", "NÃO" },
                    { 4712, "2", "0", "0", "04", "Agrega as receitas oriundas da amortização de empréstimos, financiamentos e refinanciamentos concedidos pela União, no âmbito do programa de refinanciamento da dívida externa, o Plano Brady. O Plano Brady foi um acordo firmado ao amparo da Resolução do Senado Federal nº 98, de 1992, alterada pelas Resoluções nº 90 e 132, ambas de 1993, reestruturando a dívida de médio e longo prazos (principal vencido e vincendo, assim como juros devidos e não pagos no período de 1º de janeiro de 1991 a 15 de abril de 1994) do setor público brasileiro junto aos credores privados estrangeiros, mediante emissão em 15/04/1994 de sete tipos de bônus pela União: Debt Conversion Bond, New Money Bond, Flirb, C - Bond, Discount Bond, Par Bond e EI Bond. A contratação do financiamento interno com os mutuários originais, formalizando o repasse das condições financeiras do acordo com prestações semestrais em abril e outubro, foi autorizada pelas Portarias MF nº 89, de 1996, nº 192, de 1996, nº 168, de 1997 e nº 364, de 2000, com termo em 15 de abril de 2024.", "0", "Amortização de Empréstimos - Refinanciamento de Dívidas de Médio e Longo Prazo", 2021, "23000400", null, "3", "0", "NÃO" },
