                    { 4672, "2", "0", "1", "00", "Agrega as receitas da alienação de bens intangíveis, tais como marcas, patentes, títulos de licença, direitos de franquia, direitos autorais, entre outros. A Lei de Responsabilidade Fiscal veda a aplicação da receita de capital derivada da alienação de bens e direitos que integram o patrimônio público para o financiamento de despesa corrente, salvo se destinada por lei aos regimes de previdência social, geral e próprio dos servidores públicos.", "3", "Alienação de Bens Intangíveis", 2021, "22300010", null, "2", "0", "NÃO" },
