                    { 4693, "2", "0", "1", "02", "Agrega os recursos oriundos da retenção de receitas próprias de Estados e Municípios em função do não-pagamento de dívidas nas quais a União foi garantidora. A legislação aplicável à honra de aval concedido pela União em operações de crédito externas é o Decreto-Lei nº 1.928, de 18 de fevereiro de 1982, alterado pelo Decreto-Lei nº 2.169, de 29 de outubro de 1984. Com relação à honra de aval interna, aplica-se a Lei Complementar nº 101, de 5 maio de 2000 . Quando o devedor original, por qualquer razão, não efetua o pagamento de sua dívida, a União, como garantidora, realiza o pagamento da prestação em atraso, sub-rogando-se no crédito respectivo junto ao devedor.", "0", "Amortização Proveniente da Execução de Garantia - Operações de Crédito", 2021, "23000210", null, "3", "0", "NÃO" },
                    { 4692, "2", "0", "0", "02", "Agrega os recursos oriundos da retenção de receitas próprias de Estados e Municípios em função do não-pagamento de dívidas nas quais a União foi garantidora. A legislação aplicável à honra de aval concedido pela União em operações de crédito externas é o Decreto-Lei nº 1.928, de 18 de fevereiro de 1982, alterado pelo Decreto-Lei nº 2.169, de 29 de outubro de 1984. Com relação à honra de aval interna, aplica-se a Lei Complementar nº 101, de 5 maio de 2000 . Quando o devedor original, por qualquer razão, não efetua o pagamento de sua dívida, a União, como garantidora, realiza o pagamento da prestação em atraso, sub-rogando-se no crédito respectivo junto ao devedor.", "0", "Amortização Proveniente da Execução de Garantia - Operações de Crédito", 2021, "23000200", null, "3", "0", "NÃO" },
