                    { 4683, "2", "0", "1", "01", "Agrega as receitas provenientes do Bond Exchange Agreement - BEA, acordo por meio do qual foram reestruturados juros atrasados devidos pelo setor público brasileiro no período de julho de 1989 a dezembro de 1990 a credores privados estrangeiros. Em 20 de novembro de 1992, esses juros foram permutados por bônus de emissão da União, segundo as disposições da Resolução do Senado Federal nº 20, de 1991. Pela Resolução, ficou assegurado aos mutuários originais o repasse das condições do Acordo mediante contratação dos pertinentes financiamentos internos, com prestações semestrais em junho e dezembro, autorizados pelas Portarias MF nº 211, de 1995, e nº 167, de 1997, o qual encerrou-se em 1º de janeiro de 2001. O Brazil Investment Bond Exchange Agreement - BIB representa o Acordo por intermédio do qual foram trocadas por bônus de emissão da União, em 31 de agosto de 1989, parcelas do principal da dívida devida pelo setor público brasileiro a credores externos, vencidas entre 1987 e 1993. Pela Resolução nº 96, de 1993, o Senado Federal autorizou o repasse dos benefícios do Acordo aos devedores originais, mediante celebração de contratos de financiamento interno. As Portarias MF nº 208, de 1995, e nº 166, de 1997, disciplinam a formalização dos instrumentos contratuais com prestações semestrais em março e setembro, o qual tem como vencimento em 15 de setembro de 2013.", "0", "Amortização de Empréstimos - BEA/BIB", 2021, "23000110", null, "3", "0", "NÃO" },
                    { 4682, "2", "0", "0", "01", "Agrega as receitas provenientes do Bond Exchange Agreement - BEA, acordo por meio do qual foram reestruturados juros atrasados devidos pelo setor público brasileiro no período de julho de 1989 a dezembro de 1990 a credores privados estrangeiros. Em 20 de novembro de 1992, esses juros foram permutados por bônus de emissão da União, segundo as disposições da Resolução do Senado Federal nº 20, de 1991. Pela Resolução, ficou assegurado aos mutuários originais o repasse das condições do Acordo mediante contratação dos pertinentes financiamentos internos, com prestações semestrais em junho e dezembro, autorizados pelas Portarias MF nº 211, de 1995, e nº 167, de 1997, o qual encerrou-se em 1º de janeiro de 2001. O Brazil Investment Bond Exchange Agreement - BIB representa o Acordo por intermédio do qual foram trocadas por bônus de emissão da União, em 31 de agosto de 1989, parcelas do principal da dívida devida pelo setor público brasileiro a credores externos, vencidas entre 1987 e 1993. Pela Resolução nº 96, de 1993, o Senado Federal autorizou o repasse dos benefícios do Acordo aos devedores originais, mediante celebração de contratos de financiamento interno. As Portarias MF nº 208, de 1995, e nº 166, de 1997, disciplinam a formalização dos instrumentos contratuais com prestações semestrais em março e setembro, o qual tem como vencimento em 15 de setembro de 2013.", "0", "Amortização de Empréstimos - BEA/BIB", 2021, "23000100", null, "3", "0", "NÃO" },
                    { 4681, "2", "0", "0", "00", "Agrega as receitas provenientes da amortização de financiamentos ou empréstimos concedidos pela União em títulos e contratos. Por amortização de empréstimo entende-se pagamento de empréstimo ou financiamento, em prestações fixas, sem considerar os juros e correção monetária referentes.", "0", "Amortização de Empréstimos", 2021, "23000000", null, "3", "0", "NÃO" },
