                    { 4484, "2", "1", "2", "00", "Agrega os recursos provenientes da colocação, no mercado externo, de títulos de responsabilidade do Tesouro Nacional, conforme autorizado na Lei nº 10.179, de 6 de fevereiro de 2001, e com as características definidas no Decreto nº 3.859, de 4 de julho de 2001, destinados ao refinanciamento da dívida pública.  A Lei de Responsabilidade Fiscal - LRF, define o refinanciamento da dívida mobiliária, como sendo a emissão de títulos para pagamento do principal acrescido da atualização monetária.", "2", "Títulos de Responsabilidade do Tesouro Nacional - Refinanciamento da Dívida Pública Federal no Mercado Externo", 2021, "21210020", null, "1", "0", "NÃO" },
