                    { 4475, "2", "1", "1", "00", "Agrega os recursos provenientes da colocação, no mercado externo, de títulos de responsabilidade do Tesouro Nacional, conforme autorizado na Lei nº 10.179, de 6 de fevereiro de 2001, e com as características definidas no Decreto nº 3.859, de 4 de julho de 2001, destinados a fins específicos, autorizados em normativos legais. As operações externas, de natureza financeira, dependem, ainda, de autorização do Senado Federal, conforme disposto na Constituição Federal, art. 52.", "2", "Títulos de Responsabilidade do Tesouro Nacional - Mercado Externo", 2021, "21210010", null, "1", "0", "NÃO" },
                    { 4474, "2", "1", "0", "00", "Agrega os recursos provenientes da colocação, no mercado externo, de títulos de responsabilidade do Tesouro Nacional, conforme autorizado na Lei nº 10.179, de 6 de fevereiro de 2001, e com as características definidas no Decreto nº 3.859, de 4 de julho de 2001, destinados aos diversos fins especificados em normativos legais. Os títulos da dívida pública podem ser emitidos com três finalidades: financiar o déficit orçamentário; realizar operações com fins específicos, definidos em lei; e operacionalizar a política monetária. Registra o valor da receita decorrente da colocação no mercado interno de títulos do governo federal, estadual ou municipal.", "2", "Títulos de Responsabilidade do Tesouro Nacional - Mercado Externo", 2021, "21210000", null, "1", "0", "NÃO" },
