                    { 1322, "1", "6", "2", "02", "Agrega receitas decorrentes do valor excedente ao \"preço mínimo\" pago à União em razão da concessão florestal, quando a unidade de conservação NÃO está localizada em floresta classificada como \"floresta nacional\" nos termos do art. 17 da Lei nº 9.985, de 18 de julho de 2000. O \"preço mínimo\" é definido no edital de licitação e calculado em função seja da quantidade de produto ou serviço a ser auferido do objeto da concessão, seja do faturamento líquido ou bruto das unidades localizadas na floresta nacional.", "4", "Outras Concessões Florestais - Demais Valores", 2021, "13460220", null, "3", "0", "NÃO" },
