                    { 1071, "1", "1", "2", "03", "Agrega as receitas oriundas da parcela do valor do royalty, previsto no contrato de concessão, que exceder a 5% do valor da produção de petróleo, gás natural ou outros hidrocarbonetos fluidos, quando a lavra ocorrer na plataforma continental, no mar territorial ou na zona econômica exclusiva, em contratos cuja declaração de comercialidade tenha ocorrido antes de 3/12/2012, em áreas no horizonte geológico denominado Pré-Sal*, em campos localizados na área definida no inciso IV do caput do art. 2o da Lei no 12.351, de 2010. * Entende-se por horizonte geológico denominado Pré-Sal o intervalo de rochas que se estende por baixo de uma extensa camada de sal, localizado em áreas de águas profundas, em grande parte do litoral brasileiro.", "4", "Royalties Excedentes pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade antes de 3/12/2012 - Área e Camada Pré-Sal", 2021, "13410320", null, "3", "0", "NÃO" },
