                    { 678, "1", "8", "4", "01", "Agrega o valor total das receitas recebidas por meio de cota-parte do Fundo de Participação dos Municípios (FPM), referente à alínea “e” do inciso I do art. 159 da Constituição Federal e Emenda Constitucional nº 84, de 2014.", "1", "Cota-Parte do Fundo de Participação dos Municípios - 1% Cota entregue no mês de julho", 2021, "17180140", null, "7", "0", "NÃO" },
                    { 1099, "1", "1", "1", "04", "Agrega as receitas auferidas a título de participação especial pela produção de petróleo, gás natural ou outros hidrocarbonetos fluidos em campos explorados sob regime de concessão, quando a lavra ocorrer em terra. O art. 50 da Lei no 9.478, de 6 de agosto de 1997, determina que “o edital e o contrato estabelecerão que, nos casos de grande volume de produção, ou de grande rentabilidade, haverá o pagamento de uma participação especial [...]”. Conforme dispõe o § 1o do referido art. 50, “a participação especial será aplicada sobre a receita bruta da produção, deduzidos os royalties, os investimentos na exploração, os custos operacionais, a depreciação e os tributos previstos na legislação em vigor”.", "4", "Participação Especial pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão", 2021, "13410410", null, "3", "0", "NÃO" },
                    { 1101, "1", "1", "1", "04", "Vide descrição do código de receita principal.", "4", "Participação Especial pela Produção de Petróleo em Terra (Qualquer Situação) - Contrato de Concessão - Multas e Juros de Mora", 2021, "13410412", null, "3", "2", "SIM" },
                    { 1161, "1", "2", "1", "03", "Vide descrição do código de receita principal.", "4", "Royalties Excedentes pela Produção de Petróleo em Terra - Cessão Onerosa - Declaração de Comercialidade a partir de 3/12/2012 - Multas", 2021, "13420315", null, "3", "5", "SIM" },
                    { 1160, "1", "2", "1", "03", "Vide descrição do código de receita principal.", "4", "Royalties Excedentes pela Produção de Petróleo em Terra - Cessão Onerosa - Declaração de Comercialidade a partir de 3/12/2012 - Dívida Ativa - Multas e Juros de Mora da Dívida Ativa", 2021, "13420314", null, "3", "4", "SIM" },
