                    { 1109, "1", "1", "2", "04", "Vide descrição do código de receita principal.", "4", "Participação Especial pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade antes de 3/12/2012 - Área e Camada Pré-Sal - Principal", 2021, "13410421", null, "3", "1", "SIM" },
                    { 1108, "1", "1", "2", "04", "Agrega as receitas auferidas a título de participação especial pela produção de petróleo, gás natural ou outros hidrocarbonetos fluidos em campos explorados sob regime de concessão, quando a lavra ocorrer na plataforma continental, no mar territorial ou na zona econômica exclusiva, em contratos cuja declaração de comercialidade tenha ocorrido antes de 3/12/2012, em áreas no horizonte geológico denominado Pré-Sal*, em campos localizados na área definida no inciso IV do caput do art. 2o da Lei no 12.351, de 2010. O art. 50 da Lei no 9.478, de 6 de agosto de 1997, determina que “o edital e o contrato estabelecerão que, nos casos de grande volume de produção, ou de grande rentabilidade, haverá o pagamento de uma participação especial [...]”. Conforme dispõe o § 1o do referido art. 50, “a participação especial será aplicada sobre a receita bruta da produção, deduzidos os royalties, os investimentos na exploração, os custos operacionais, a depreciação e os tributos previstos na legislação em vigor”. * Entende-se por horizonte geológico denominado Pré-Sal o intervalo de rochas que se estende por baixo de uma extensa camada de sal, localizado em áreas de águas profundas, em grande parte do litoral brasileiro.", "4", "Participação Especial pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade antes de 3/12/2012 - Área e Camada Pré-Sal", 2021, "13410420", null, "3", "0", "NÃO" },
