                    { 1128, "1", "1", "4", "04", "Vide descrição do código de receita principal.", "4", "Participação Especial pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade a partir de 3/12/2012 - Qualquer Situação - Multas e Juros de Mora", 2021, "13410442", null, "3", "2", "SIM" },
                    { 1127, "1", "1", "4", "04", "Vide descrição do código de receita principal.", "4", "Participação Especial pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade a partir de 3/12/2012 - Qualquer Situação - Principal", 2021, "13410441", null, "3", "1", "SIM" },
                    { 1126, "1", "1", "4", "04", "Agrega as receitas auferidas a título de participação especial pela produção de petróleo, gás natural ou outros hidrocarbonetos fluidos em campos explorados sob regime de concessão, quando a lavra ocorrer na plataforma continental, no mar territorial ou na zona econômica exclusiva, em contratos cuja declaração de comercialidade tenha ocorrido a partir de 3/12/2012. O art. 50 da Lei no 9.478, de 6 de agosto de 1997, determina que “o edital e o contrato estabelecerão que, nos casos de grande volume de produção, ou de grande rentabilidade, haverá o pagamento de uma participação especial [...]”. Conforme dispõe o § 1o do referido art. 50, “a participação especial será aplicada sobre a receita bruta da produção, deduzidos os royalties, os investimentos na exploração, os custos operacionais, a depreciação e os tributos previstos na legislação em vigor”.", "4", "Participação Especial pela Produção de Petróleo em Plataforma - Contrato de Concessão - Declaração de Comercialidade a partir de 3/12/2012 - Qualquer Situação", 2021, "13410440", null, "3", "0", "NÃO" },
