                    { 57, "1", "3", "1", "02", "Agrega as receitas originadas do imposto incidente sobre o lucro das pessoas jurídicas de direito privado em geral e das chamadas empresas individuais, nas quais enquadram-se as firmas individuais e as pessoas físicas que exploram, com habitualidade, qualquer atividade econômica objetivando o lucro. A base de cálculo do imposto é o lucro real, o lucro presumido ou o lucro arbitrado. Nesta natureza, está excluída a parcela do imposto de renda pago por pessoas jurídicas que fizeram opção pela aplicação em projetos considerados prioritários para o desenvolvimento das regiões Norte, Nordeste e do Estado do Espírito Santo, conforme Medida Provisória n.º 2.199-14, de 24 de agosto de 2001.", "1", "Imposto sobre a Renda de Pessoa Jurídica - IRPJ - Líquida de Incentivos", 2021, "11130210", null, "1", "0", "NÃO" },
