                    { 8, "1", "1", "1", "01", "Vide descrição do código de receita principal.", "1", "Imposto sobre a Importação - Multas e Juros de Mora", 2021, "11110112", null, "1", "2", "SIM" },
                    { 7, "1", "1", "1", "01", "Registra as receitas dos impostos sobre a importação e que não decorrem de parcelamentos ou outros institutos que facilitem seu pagamento. Constitui a principal parcela da arrecadação proveniente da incidência do referido tributo quando da ocorrência do fato gerador previsto no art. 19, do Código Tributário Nacional e não decorra de parcelamentos ou outros institutos que facilitem o seu pagamento previstos em lei específica. A entrada de mercadoria estrangeira em território nacional e destinadas ao comércio do país é o fato gerador dessa incidência. É tributo de competência exclusiva da União.  O imposto de importação possui função extrafiscal, pois, sua principal característica não é a arrecadação e sim a regulação do mercado interno (controle da balança comercial) fundamentadas por razões provenientes da política econômica. Consiste em um importante instrumento de regulação, de função econômica, e por esse motivo não sofre a incidência do Princípio da Legalidade, nem da anterioridade, podendo suas alíquotas serem alteradas por Decreto presidencial. Um dos principais motivos da extrafiscalidade do imposto de importação é proteger os produtos nacionais da concorrência dos produtos estrangeiros.  Tem como contribuinte o importador ou quem a lei a ele equiparar ou o arrematante de produtos apreendidos/abandonados.", "1", "Imposto sobre a Importação - Principal", 2021, "11110111", null, "1", "1", "SIM" },
                    { 6, "1", "1", "1", "01", "Agrega as receitas que se originaram dos impostos sobre a importação e que não decorrem de parcelamentos ou outros institutos que facilitem seu pagamento. Constitui a principal parcela da arrecadação proveniente da incidência do referido tributo quando da ocorrência do fato gerador previsto no art. 19, do Código Tributário Nacional e não decorra de parcelamentos ou outros institutos que facilitem o seu pagamento previstos em lei específica. A entrada de mercadoria estrangeira em território nacional e destinadas ao comércio do país é o fato gerador dessa incidência. É tributo de competência exclusiva da União.  O imposto de importação possui função extrafiscal, pois, sua principal característica não é a arrecadação e sim a regulação do mercado interno (controle da balança comercial) fundamentadas por razões provenientes da política econômica. Consiste em um importante instrumento de regulação, de função econômica, e por esse motivo não sofre a incidência do Princípio da Legalidade, nem da anterioridade, podendo suas alíquotas serem alteradas por Decreto presidencial. Um dos principais motivos da extrafiscalidade do imposto de importação é proteger os produtos nacionais da concorrência dos produtos estrangeiros.  Tem como contribuinte o importador ou quem a lei a ele equiparar ou o arrematante de produtos apreendidos/abandonados.", "1", "Imposto sobre a Importação", 2021, "11110110", null, "1", "0", "NÃO" },
                    { 5, "1", "1", "0", "01", "Agrega as receitas que se originaram dos impostos sobre a importação. De competência da União, o imposto de importação possui natureza regulatória e arrecadatória e incide sobre a importação de mercadorias estrangeiras. São contribuintes o importador e o arrematante de produtos apreendidos ou abandonados.", "1", "Imposto sobre a Importação", 2021, "11110100", null, "1", "0", "NÃO" },
                    { 4, "1", "1", "0", "00", "Agrega as receitas que se originaram de impostos cobrados sobre a exportação e sobre a importação.", "1", "Impostos sobre o Comércio Exterior", 2021, "11110000", null, "1", "0", "NÃO" },
                    { 3, "1", "0", "0", "00", "Agrega as receitas que se originaram de impostos. Impostos constituem modalidade de tributo cuja cobrança tem por fato gerador situação independente de qualquer atividade estatal específica, relativa ao contribuinte. Regra geral, é vedada a vinculação da receita de impostos a qualquer tipo de despesa, ressalvada, entre outras hipóteses, aquelas previstas na Constituição Federal.", "1", "Impostos", 2021, "11100000", null, "1", "0", "NÃO" },
                    { 2, "1", "0", "0", "00", "Agrega as receitas originadas de impostos, taxas e contribuições de melhoria.", "0", "Impostos, Taxas e Contribuições de Melhoria", 2021, "11000000", null, "1", "0", "NÃO" },
                    { 1, "1", "0", "0", "00", "Agrega as receitas tributária, de contribuições, patrimonial, agropecuária, industrial, de serviços e outras e, ainda, as provenientes de recursos financeiros recebidos de outras pessoas de direito público ou privado, quando destinadas a atender despesas classificáveis em despesas correntes.", "0", "Receitas Correntes", 2021, "10000000", null, "0", "0", "NÃO" },
