                    { 162, "1", "5", "2", "01", "Vide descrição do código de receita principal.", "1", "Imposto sobre Operações Financeiras - IOF - Demais Operações - Principal", 2021, "11150121", null, "1", "1", "SIM" },
                    { 161, "1", "5", "2", "01", "Agrega as receitas originadas do Imposto sobre Operações Financeiras, tais como operações de crédito, câmbio, seguro, assim como as relativas a títulos e valores mobiliários. Considerando-se o fato gerador, quanto às operações de crédito, sua efetivação pela entrega total ou parcial do montante ou do valor que constitua o objeto das obrigações, ou sua colocação à disposição do interessado; quanto às operações de câmbio, sua efetivação pela entrega de moeda nacional ou estrangeira, ou de documento que a represente, ou sua colocação à disposição do interessado, em montante equivalente à moeda estrangeira ou nacional entregue ou posta à disposição por este; quanto às operações de seguro, sua efetivação pela emissão da apólice ou do documento equivalente, ou o recebimento do prêmio, na forma da lei aplicável; e quanto às operações relativas a títulos e valores mobiliários, a emissão, transmissão, pagamento ou resgate destes, na forma da lei aplicável.", "1", "Imposto sobre Operações Financeiras - IOF - Demais Operações", 2021, "11150120", null, "1", "0", "NÃO" },
