                    { 94, "1", "3", "4", "03", "Agrega as receitas originadas do imposto sobre a renda incidente sobre importâncias pagas ou creditadas por pessoa jurídica a: pessoa jurídica, a título de comissões e corretagens, serviços de propaganda prestados, remuneração de serviços profissionais e serviços de limpeza, conservação, segurança e locação de mão-de-obra; beneficiários não identificados, desde que as importâncias pagas não tenham natureza de rendimentos do trabalho; pessoa física ou jurídica, inclusive isenta, correspondentes a multa ou qualquer outra vantagem; cooperativas de trabalho, por serviços prestados, prêmios distribuídos mediante concursos e sorteios de qualquer espécie; prêmios distribuídos em decorrência de jogos de bingo; prêmios pagos a proprietários e criadores de cavalos de corrida; benefícios líquidos resultantes da amortização antecipada de títulos de capitalização mediante sorteio; importâncias pagas a títulos de juros e indenizações por lucros cessantes, decorrentes de sentença judicial; importâncias pagas a título de indenização por danos morais, decorrentes de sentença judicial e importâncias pagas a título de cobertura por sobrevivência em seguro de vida.", "1", "Imposto sobre a Renda - Retido na Fonte - Outros Rendimentos", 2021, "11130340", null, "1", "0", "NÃO" },
