                    { 103, "1", "4", "0", "00", "Agrega as receitas originadas de impostos sobre a produção e a circulação. Estão incluídas neste grupo as receitas originadas dos seguintes impostos: sobre Produtos Industrializados - IPI e sobre Operações de Crédito, Câmbio e Seguro, ou Relativas a Títulos ou Valores Mobiliários - IOF, de competência da União; sobre Operações Relativas à Circulação de Mercadorias e sobre Prestações de Serviços de Transporte Interestadual e Intermunicipal e de Comunicação - ICMS, de competência dos Estados e do Distrito Federal; e Imposto sobre Serviços de Qualquer Natureza - ISS, de competência dos Municípios e do Distrito Federal.", "1", "Impostos sobre a Produção e Circulação de Mercadorias e Serviços", 2021, "11140000", null, "1", "0", "NÃO" },
                    { 104, "1", "4", "0", "01", "Agrega as receitas originadas do Imposto sobre Produtos Industrializados.  Industrialização, entendida como a modificação de natureza ou finalidade do produto, ou ainda o seu aperfeiçoamento para consumo. Quanto ao aspecto temporal, considera-se que o fato gerador ocorreu no momento do desembaraço aduaneiro, quando os produtos são de procedência estrangeira; na saída do respectivo estabelecimento produtor, quando produzidos no país; ou na ocasião da apreensão e leilão, no caso de arrematação. Quando a industrialização se der no próprio local de consumo ou de utilização do produto, o fato gerador considerar-se-á ocorrido no momento em que ficar concluída a operação industrial.", "1", "Imposto sobre Produtos Industrializados - IPI", 2021, "11140100", null, "1", "0", "NÃO" },
                    { 105, "1", "4", "1", "01", "Agrega as receitas originadas do Imposto sobre Produtos Industrializados incidente sobre fumo (tabaco) manufaturado e não manufaturado, assim como sobre seus sucedâneos manufaturados (charutos, cigarrilhas e cigarros).", "1", "Imposto sobre Produtos Industrializados - IPI - Fumo", 2021, "11140110", null, "1", "0", "NÃO" },
