                    { 2605, "1", "0", "0", "04", "Agrega receitas remanescentes de recursos da contribuição de servidores federais anteriormente habilitados a aderir ao Montepio Civil da União (instituto não recepcionado pela Constituição Federal de 1988) para pagamento de pensão a seus dependentes.Eram habilitados para solicitar adesão ao Montepio Civil da União os Ministros do Supremo Tribunal Federal, do Tribunal Federal de Recursos, do Tribunal Superior do Trabalho e do Tribunal de Contas da União; os Juízes dos Tribunais Regionais do Trabalho, os Juízes-Presidentes de Juntas de Conciliação e Julgamento e os Juízes do Trabalho-Substitutos; os Juízes Federais; os Desembargadores do Tribunal de Justiça do Distrito Federal e os Juízes de Direito do Distrito Federal; os Desembargadores do Tribunal de Justiça do Estado do Rio de Janeiro e os Juízes de Direito, no mesmo Estado, ambos de investidura federal; e o Procurador-Geral do Tribunal de Contas da União. A alíquota da contribuição é de 4%, incidente sobre os vencimentos e acréscimos percebidos mensalmente pelo contribuinte. Segundo o Parecer AGU/AG-01/2012, da Advocacia Geral da União, o montepio detém natureza de previdência complementar, ainda que ajustado como um contrato ou como uma poupança; por isso, na essência, deve ser tratado num contexto de relações de natureza previdenciária.", "9", "Contribuição ao Montepio Civil", 2021, "19900400", null, "9", "0", "NÃO" },
