                    { 2545, "1", "0", "1", "03", "Agrega receitas decorrentes do produto de depósitos abandonados (dinheiro ou objetos de valor), sendo originária da extinção de contratos de depósito regular e voluntário de bens de qualquer espécie por decurso de prazo. Extintos os contratos de depósito regular e voluntário de bens de qualquer espécie, são considerados abandonados os bens não-reclamados pelos seus proprietários no prazo de cinco anos após o fim do contrato. Aplicam-se essas disposições aos créditos resultantes de contratos de qualquer natureza em poder de estabelecimentos bancários, comerciais, industriais e Caixas Econômicas, não movimentados ou reclamados durante 25 anos.", "3", "Depósitos Abandonados (Dinheiro e/ou Objetos de Valor)", 2021, "19300310", null, "9", "0", "NÃO" },
