                    { 2645, "1", "0", "0", "08", "Agrega as receitas provenientes do Seguro Obrigatório de Danos Pessoais Causados por Veículos Automotores de Via Terrestre - DPVAT. As companhias seguradoras que mantêm o seguro obrigatório de danos pessoais causados por veículos automotores de vias terrestres deverão repassar à Seguridade Social 50% (cinquenta por cento) do valor total do prêmio. Os outros 50% permanecem com as companhias seguradoras, não constituindo receita pública.", "9", "Prêmio do Seguro Obrigatório de Danos Pessoais causados por Veículos Automotores de Via Terrestre - DPVAT", 2021, "19900800", null, "9", "0", "NÃO" },
                    { 2646, "1", "0", "1", "08", "Agrega as receitas provenientes do Seguro Obrigatório de Danos Pessoais Causados por Veículos Automotores de Via Terrestre - DPVAT. As companhias seguradoras que mantêm o seguro obrigatório de danos pessoais causados por veículos automotores de vias terrestres deverão repassar à Seguridade Social 50% (cinquenta por cento) do valor total do prêmio. Os outros 50% permanecem com as companhias seguradoras, não constituindo receita pública.", "9", "Prêmio do Seguro Obrigatório de Danos Pessoais causados por Veículos Automotores de Via Terrestre - DPVAT", 2021, "19900810", null, "9", "0", "NÃO" },
                    { 2647, "1", "0", "1", "08", "Vide descrição do código de receita principal.", "9", "Prêmio do Seguro Obrigatório de Danos Pessoais causados por Veículos Automotores de Via Terrestre - DPVAT - Principal", 2021, "19900811", null, "9", "1", "SIM" },
                    { 2665, "1", "0", "0", "10", "Agrega as receitas de quota anual de reversão, que tem como finalidade prover recursos para reversão, encampação, expansão e melhoria dos serviços públicos energia elétrica. A quota é fixada em 2,5% e incide sobre os investimentos dos concessionários do serviço público de energia elétrica, observado o limite de 3% da receita anual do concessionário.", "9", "Reserva Global de Reversão", 2021, "19901000", null, "9", "0", "NÃO" },
