                    { 2032, "1", "8", "1", "01", "Agrega o valor total dos recursos financeiros recebidos de pessoas físicas, decorrentes de doações, contratos, acordos, ajustes ou outros instrumentos, quando destinados a atender despesas especificamente destinados a programas de saúde.", "7", "Transferências de Pessoas Físicas - Específicas de E/DF/M - Programas de Saúde", 2021, "17780110", null, "7", "0", "NÃO" },
