                    { 1584, "1", "0", "1", "01", "Agrega as receitas de serviços de atendimento à saúde, de caráter especializado ou não. Compreende a prestação de serviços relacionados à saúde humana em hospitais, ambulatórios, consultórios, clínicas, centros de assistência psicossocial, unidades móveis de atendimento a urgências e remoções e, também, os serviços de saúde prestados nos domicílios. Compreende também as atividades de apoio à gestão dos estabelecimentos de saúde e as atividades de práticas integrativas e complementares à saúde humana.", "3", "Serviços de Atendimento à Saúde", 2021, "16300110", null, "6", "0", "NÃO" },
                    { 1583, "1", "0", "0", "01", "Agrega as receitas originadas de serviços de atendimento à saúde, de caráter especializado ou não. Compreende a prestação de serviços relacionados à saúde humana em hospitais, ambulatórios, consultórios, clínicas, centros de assistência psicossocial, unidades móveis de atendimento a urgências e remoções e, também, os serviços de saúde prestados nos domicílios.", "3", "Serviços de Atendimento à Saúde", 2021, "16300100", null, "6", "0", "NÃO" },
